import { Checkbox, Container, TextField, Typography } from "@mui/material";
import { Box, Stack } from "@mui/system";
import React from "react";

const BrandFilter = () => {
  // brands data structure
  const brands1 = [
    { id: "0a", brandName: "puma" },
    { id: "0b", brandName: "adiddas" },
    { id: "0c", brandName: "wildcraft" },
    { id: "0d", brandName: "levis" },
    { id: "0e", brandName: "celio" },
  ];
  return (
    <Container>
      <Stack>
        <Typography variant="h3">Brand Filter</Typography>
        <TextField
          placeholder="Enter A Brand Name"
          label="Brand name"
          variant="standard"
        />
        {brands1.map((item) => {
          return <Checkbox label={item.brandName} />;
        })}
      </Stack>
    </Container>
  );
};

export default BrandFilter;
